import React from "react"
import './App.css'
import Nav from './Navbar'
import Tables from './components/Table';
import TableSelection from "./components/TableSelection";


const Home = () =>{
  return(
    <>
    <Nav/>
    <h1>This is Home Page</h1>
    <br></br>
    <TableSelection/>
    <br></br>
    <div className="tablesCSS">
     
     
      <Tables/>
    </div>
    
    
    </>
  )
}

export default Home
